import SignIn from '../components/sign-in/sign-in.component';
import SignUp from '../components/sign-up/sign-up.components';

const Auth = () => {
    return (
        <div className='sign-in-sign-up-form'>
            <SignIn />
            <SignUp />
        </div>
    )
}


export default Auth;
